import React, {Component} from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import Users from './Users/Users';
import Posts from './Posts/Posts';
import CommentSection from "./CommentSection/CommentSection";
import Navigation from "./Navigation/Navigation";
import Grid from '@material-ui/core/Grid';

class AppContainer extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        const style={
            Grid:{marginRight:15, minWidth:250},
        };
        return (
            <BrowserRouter>
                <div>
                    <Navigation/>
                    <Grid container wrap={"nowrap"} direction={"row"}>
                        <Grid style={style.Grid} item><Route exact path={["/", "/user/:id"]} component={Users}/></Grid>
                        <Grid item sm={10}><Route exact path={["/", "/user/:id"]} component={Posts}/></Grid>
                    </Grid>
                    <Route path="/user/:id/post/:idpost/comments/" component={CommentSection}/>
                </div>
            </BrowserRouter>
        )
    }
}


export default AppContainer;
